public class NegativeDataType {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = -1;
		int b= -56;
		double c= -38.95;
		double d = -58.50;
		float e = -5.75f;
		float f =-3.75f;
		System.out.println("Two Negative Integer"+a +" " +b);
		System.out.println("Two Negative Double"+c +" " +d);
		System.out.println("Two Negative Float"+e +" " +f);
				
	}

}
